import React from 'react'
import Suggestions from "./Suggestions";

const HomeRight = () => {
    return(
        <div className="border">
            <div>
                <div>
                    <div className="space-y-5 px-2 mt-10">
                        Friend Recommendations
                    </div>
                    <div className="space-y-5 px-2 mt-10">
                        {[1, 1, 1, 1, 1].map((item) => <Suggestions/>)}
                    </div>


                </div>
            </div>
        </div>
    )
}

export default HomeRight
